import React  from 'react';
import styled from 'styled-components';
import {FaPhoneAlt,FaRegEnvelope} from 'react-icons/fa';


const MainContectSection=styled.div`
width           : 100%;
height          : 80vh;
background-color: whitesmoke;
`;

const Cards=styled.div`
width: 100%;
height: 130px;
background-color: violet;
margin-top: 7%;
`;

const SmallCards=styled.div`
 width: 300px;
 background-color: whitesmoke;
 height: 90px;
 margin-left: 20px;
 margin-top: 20px;
 border-radius: 10px;
 display: flex;
 justify-content: start;
 align-items: center;
`;
const Contact = () => {
    return (
       
<MainContectSection>
         <Cards>
         <div class = "container">
         <div class = "row">
         <div class = "col-sm">
             <SmallCards>
                  <FaPhoneAlt/>
                 <h3>Phone</h3>
                 <p>+92 032287161</p>
             </SmallCards>
         </div>
        <div class = "col-sm">
            <SmallCards>
                <FaRegEnvelope/>
                 <h3>Support Mail</h3>
                 <p>Support@SpinzerBurger.com</p>

            </SmallCards>
        </div>
        <div class = "col-sm">
            <SmallCards>

            </SmallCards>
        </div>
        </div>
        </div>
         </Cards>
</MainContectSection>
    )
}

export default Contact
